import React, { useEffect, useReducer } from 'react'
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const reducer = (state, action) => {
    switch (action.type) {
        case 'CREATE_REQUEST':
            return { ...state, loading: true };
        case 'CREATE_SUCCES':
            return { ...state, loading: false };
        case 'CREATE_FAIL':
            return { ...state, loading: false };

        default:
            break;
    }
}


const CheckoutPlaceorder = () => {

    const [{ loading, error }, dispatch] = useReducer(reducer, {
        loading: false,
        error: '',
    });

    const state = useSelector((state) => state.controlItems);
    const {
        cart: { shippingAddress, billingAddress, paymentMethod },
    } = state;

    const ProcedeToPay = (value) => {
        const navigate = useNavigate();
        useEffect(() => {
            //crear orden
            switch (value) {
                case 'transferencia':
                    navigate('/checkout/payorder/transf');
                    break;
                case 'webpay':
                    navigate('/checkout/payorder/webpay');
                    break;
                case 'khipu':
                    navigate('/checkout/payorder/khipu');
                    break;
                case 'paypal':
                    navigate('/checkout/payorder/paypal');
                    break;
                default:
                    navigate('/checkout/placeorder');
                    break;
            }
        }, [value, navigate]);
    };

    const SendData = () => {
        return (
            <>
                <div className="col md-8">
                    <div className=" ">
                        <h5 className=" ">Envío </h5>
                        <p className=''>
                            <strong className='mx-2'>Nombre:</strong>{shippingAddress.fullName} <br />
                            <strong className='mx-2'>Rut:</strong>{shippingAddress.rut}
                            <strong className='ms-4 mx-2'>Tel.:</strong>{shippingAddress.addressPhone} <br />
                            <strong className='mx-2'>Nombre:</strong>{shippingAddress.fullName} <br />
                        </p>
                    </div>
                </div>
            </>
        );
    };

    const BillingData = () => {
        return (
            <>
                <p className=''>
                    <strong className='mx-2'>Tipo:</strong>{'Factura'} <br />
                    <strong className='mx-2'>Nombre:</strong>{billingAddress.name} <br />
                    <strong className='mx-2'>Rut:</strong>{billingAddress.rut}
                    <strong className='ms-4 mx-2'>Giro:</strong>{billingAddress.giro} <br />
                    <strong className='mx-2'>Dirección:</strong>{billingAddress.address}, {billingAddress.city}, {billingAddress.region}, {billingAddress.postal}<br />
                </p>

            </>
        );
    };
    const PaymentData = () => {
        return (
            <>
                <div className="row">
                    <div className="col-5 my-1">
                        <h5 className="mt-3">Método de Pago </h5>
                        <p className='mb-4'>
                            <strong className='mx-2'>{paymentMethod}</strong>
                        </p>
                    </div>
                    <div className="col-lg-6 d-grid py-2">
                        <button className="btn btn-outline-primary btn-lg fw-bold " onClick={() => { ProcedeToPay(paymentMethod) }} style={{ fontSize: '25px' }}>PAGAR</button>
                    </div>
                </div>
            </>
        );
    }
    return (
        <div className='col-9 mx-auto'>
            <h1 className='mb-3 text-center'>Revisa tu orden</h1>
            <div className="row">
                <SendData />
            </div>
            <div className="row">
                <div className="col md-8">
                    <div className="">
                        <div className=" ">
                            <h5 className=" ">Facturación </h5>
                            {billingAddress.type === 'invoice' ? <BillingData /> : <p className='card-text'><strong className='mx-2'>Boleta</strong></p>}
                        </div>
                    </div>
                </div>
            </div>
            <div className="row">
                <PaymentData />
            </div>
        </div>
    )
}

export default CheckoutPlaceorder
